import React,{useState} from 'react'
import { BrowserRouter as Router,Route,useHistory} from 'react-router-dom'
import SideNav, { Toggle, Nav, NavItem, NavIcon, NavText } from '@trendmicro/react-sidenav';

// Be sure to include styles at some point, probably during your bootstraping
import '@trendmicro/react-sidenav/dist/react-sidenav.css'; 
import FeedBack from './FeedBack';
import LandlordAccountReview from './LandlordAccountReview';
import Register from './Register';
const SidebarExampleTransitions=()=>{
 const history = useHistory()
  const [activeItem, setActiveItem] = useState({
    name: 'listing'
  })

  const handleItemClick = (e, { name }) => {
    setActiveItem(name)
  }
  return (
    <div>
      <Router>
    <Route render={({ location, history }) => (
        <React.Fragment>
      <SideNav
     onSelect={(selected) => {
      const to = '/' + selected;
      if (location.pathname !== to) {
          history.push(to);
      }
  }}
>

    <SideNav.Nav defaultSelected="home">
        <NavItem eventKey="home">
            <NavIcon>
                <i className="fa fa-fw fa-home" style={{ fontSize: '1.75em' }} />
            </NavIcon>
            <NavText>
                Home
            </NavText>
        </NavItem>
        <NavItem eventKey="charts">
            <NavIcon>
                <i className="fa fa-fw fa-line-chart" style={{ fontSize: '1.75em' }} />
            </NavIcon>
            <NavText>
                Charts
            </NavText>

        </NavItem>
    </SideNav.Nav>
</SideNav>
<main>
                <Route path="/register" exact component={props => <Register />} />
                <Route path="/home" component={props => <FeedBack />} />
                <Route path="/devices" component={props => <LandlordAccountReview />} />
            </main>
        </React.Fragment>
    )}
    />
</Router>
    </div>
  )
}

export default SidebarExampleTransitions
